const pancakesGrid = document.getElementById('pancakesGrid');

// Function to display pancake recipes
function displayPancakeRecipes(recipes) {
    pancakesGrid.innerHTML = '';
    recipes.forEach(recipe => {
        const card = document.createElement('div');
        card.className = 'pancake-card';
        card.innerHTML = `
            <img src="${recipe.image}" alt="${recipe.title}">
            <h2>${recipe.title}</h2>
            <p>${recipe.description}</p>
        `;
        pancakesGrid.appendChild(card);
    });
}

// Initial display of all pancake recipes
displayPancakeRecipes(pancakeRecipes);
